description:
INTUITIVE THERAPEUTICS - CGM, Tubeless Insulin Pumps, Advanced Diabetes Technology!
&nbsp;
Intuitive Therapeutics Limited is a distributor of&nbsp;continuous glucose monitoring (CGM) systems, tubeless patch insulin pumps and other advanced medical technologies&nbsp;based in Aotearoa New Zealand. We are run by people living with type one diabetes, for people living with type one diabetes. We specialise in equipping people with advanced technological solutions to simplify therapy and unleash a higher level of health and quality of life than they previously dreamed possible.
&nbsp;
